import {Route, BrowserRouter as Router, Switch} from 'react-dom'
import login from './pages/login'


function App() {
  return (
    <div className="App">
	<Router>
          <Switch>
	    <route path = '/login'>
		<login />
	    </route>
	  </Switch>	
        </Router>
    </div>
  );
}

export default App;
